import React, { Component } from "react";
import Slider from "react-slick";
import Head from "next/head";

class SlideShow extends Component {
  render() {
    const settings = {
      className: "center",
      centerMode: true,
      infinite: true,
      centerPadding: "60px",
      slidesToShow: 3,
      speed: 500
    };
    return (
      <div>
        <Head>
            <link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" /> 
            <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" />
            <link rel="stylesheet" type="text/css" href="/static/css/slick1.css" />
        </Head>
        <style jsx>{`
            h3{
              background: #5f9ea0;
              color: #fff;
              font-size: 36px;
              line-height: 100px;
              margin: 10px;
              padding: 2%;
              position: relative;
              text-align: center;
            }
            .slick-prev:before {
              color: green;
            }
            .slick-next:before {
              color: some-color;
            }
          
            .slick-center {
              -webkit-transform: scale(1.25);
              -moz-transform: scale(1.25);
              transform: scale(1.25);
          }
        `}</style>
        <Slider {...settings}>
          <div>
            <h3><img src="/static/images/test/test1.png" className="img-fluid" /></h3>
          </div>
          <div>
            <h3><img src="/static/images/test/test2.png" className="img-fluid" /></h3>
          </div>
          <div>
            <h3><img src="/static/images/test/test2.png" className="img-fluid" /></h3>
          </div>
          <div>
            <h3><img src="/static/images/test/test4.png" className="img-fluid" /></h3>
          </div>
          <div>
            <h3><img src="/static/images/test/test1.png" className="img-fluid" /></h3>
          </div>
          <div>
            <h3><img src="/static/images/test/test2.png" className="img-fluid" /></h3>
          </div>
        </Slider>
      </div>
    );
  }
}

export default SlideShow;
